import React, { Component } from "react"

export default class Resposta extends Component {
    render() {
        return (
            <div>
                <span className="form-control">{this.props.descricao}</span>
                {this.props.remover &&
                <button className="btn btn-danger" onClick={this.props.remover}>Remover</button>
                }
            </div>
        )
    }
}
